import React from "react";

const About = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <span>
        We are group F00Lstack, addressing the first Challenge Problem:{" "}
      </span>
      <br>
        <span>
          {" "}
          Solutions that improve the quality of life of Singaporeans while they
          are overseas (either for short term or long-term)
        </span>
      </br>
    </div>
  );
};

export default About;
